function createPopover(targetObject, noticeTitle, noticeText){
  var obj = targetObject;
  obj.popover({
    trigger: 'manual',
    placement: 'bottom',
    html: true,
    content: noticeText,
    title: noticeTitle,
    show: function(){
      $(this).css({'visibility': 'hidden', scale: 0});
      $(this).velocity({'visibility': 'visible', scale: 1});
    }
  });


  obj.popover('show');
  return obj;
}


